Lip Service - Episode 1

First broadcast: BBC HD, 10:30pm Tue, 12 Oct 2010

Funny, irreverent and moving drama series which follows the interwoven love lives of Frankie, Cat and Tess,three gay women living in Glasgow whose search for happiness stirs up hidden passions and secrets.

When Frankie returns to Glasgow to investigate a mysterious message left by her dying aunt,her sudden reappearance rocks ex-girlfriend Cat, who is re-entering the dating scene after Frankie left her heartbroken two years earlier. Will her blind date with policewoman Sam be ruined? 

Aspiring actress Tess has a humiliating run-in with her ex-girlfriend,
but things start to look up when she finds herself being hit on by a gorgeous,
and supposedly straight, TV presenter.

Starring: Laura Fraser, Fiona Button, James Anthony Pearson, Roxanne Mckee, Romana Abercrombie, Lisa Livingstone, Ruta Gedmintas, Emun Elliott &amp; Heather Peace.

